import "./App.css";
import axios from "axios";
import { useState } from "react";

function App() {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [age, setAge] = useState();
  const [talent, setTalent] = useState();

  const submitHandler1 = async (e) => {
    e.preventDefault();

    console.log(firstName);
    console.log(lastName);
    console.log(age);
    console.log(talent);

    try {
      const jsonServerData = await axios
        .get("http://localhost:4000/people", {})
        .then(
          (response) => {
            console.log(response);
          },
          (error) => {
            console.log(error);
          }
        );
    } catch (error) {
      console.log(error);
    }
    console.log(jsonServerData);
    try {
      await axios
        .post("http://localhost:4000/people", {
          firstName,
          lastName,
          age,
          talent,
        })
        .then(
          (response) => {
            console.log(response);
          },
          (error) => {
            console.log(error);
          }
        );
    } catch (error) {
      console.log(error);
    }
  };

  const submitHandler2 = async (e) => {
    e.preventDefault();

    try {
      await axios.get("http://localhost:3000", {}).then(
        (response) => {
          console.log(response);
        },
        (error) => {
          console.log(error);
        }
      );
    } catch (error) {
      console.log(error);
    }
  };

  const submitHandler3 = async (e) => {
    e.preventDefault();

    try {
      await axios.get("http://localhost:8080", {}).then(
        (response) => {
          console.log(response);
        },
        (error) => {
          console.log(error);
        }
      );
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <form>
        <table>
          <tbody>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Age</th>
              <th>Talent</th>
            </tr>
            <tr>
              <td>
                <input
                  className="firstName"
                  type="text"
                  placeholder="First Name"
                  value={firstName}
                  onChange={(e) => setFirstName(e.target.value)}
                />
              </td>
              <td>
                <input
                  className="lastName"
                  type="text"
                  placeholder="Last Name"
                  value={lastName}
                  onChange={(e) => setLastName(e.target.value)}
                />
              </td>
              <td>
                <input
                  className="age"
                  type="number"
                  placeholder="Age"
                  value={age}
                  onChange={(e) => setAge(e.target.value)}
                />
              </td>
              <td>
                <input
                  className="talent"
                  type="number"
                  placeholder="Talent"
                  value={talent}
                  onChange={(e) => setTalent(e.target.value)}
                />
              </td>
            </tr>
          </tbody>
        </table>
        <br></br>
        <div>
          <button className="button1" onClick={submitHandler1} type="submit">
            1
          </button>
          <button className="button2" onClick={submitHandler2} type="submit">
            2
          </button>
          <button className="button3" onClick={submitHandler3} type="submit">
            3
          </button>
        </div>
      </form>
    </div>
  );
}

export default App;
